import React from 'react';
import Head from 'next/head';
import OtherLayout from '../components/OtherLayout';

const About = () => (
  <>
    <Head>
      <title>Study Board | About</title>
    </Head>
    <OtherLayout>

      <div>about</div>
    </OtherLayout>
  </>
);

export default About;
